import React from 'react';
import '../../styles/Registration.css';
import AccountBox from '@material-ui/icons/AccountBox';
import {Button, FormControl, Input, InputAdornment, InputLabel, Typography} from "@material-ui/core";
import {makeStyles} from "@material-ui/core/styles";
import RegistrationService from '../../services/registration.service';
import getHostName from "../../services/host.service";
import LoginService from "../../services/login.service";
import history from "../../misc/history";
import Box from '@material-ui/core/Box';

const useStyles = makeStyles((theme) => ({
    margin: {
        margin: theme.spacing(1),
    },
}));

function ProfileScreen() {

    const classes = useStyles();



    return(

        <div>

            { LoginService.isLoggedIn() ? (
                <div>
                    <Box display="flex" flexWrap="wrap" alignItems="center"  className={classes.root}>
                        <Box pl={5} pr={5} pt={3} border={1} borderColor="grey.500" boxShadow="3px 3px 3px #9E9E9E">
                            <Typography gutterBottom variant="h4" align="center">
                                {testPodaci.associationCount}
                            </Typography>

                            <Typography gutterBottom variant="subtitle1" align="center">
                                udruga
                            </Typography>
                        </Box>

                        <Box pt={3} pl={5} pr={5} border={1} borderColor="grey.500" boxShadow="3px 3px 3px #9E9E9E">
                            <Typography gutterBottom variant="h4" align="center">
                                {testPodaci.walkCount}
                            </Typography>

                            <Typography gutterBottom variant="subtitle1" align="center">
                                šetnji
                            </Typography>
                        </Box>

                        <Box pt={3} pl={5} pr={5} border={1} borderColor="grey.500" boxShadow="3px 3px 3px #9E9E9E">
                            <Typography gutterBottom variant="h4" align="center">
                                {testPodaci.timeSpent}
                            </Typography>

                            <Typography gutterBottom variant="subtitle1" align="center">
                                provedeno u šetnjama
                            </Typography>
                        </Box>

                        <Box pr={5} pl={5} pt={3} border={1} borderColor="grey.500" boxShadow="3px 3px 3px #9E9E9E">
                            <Typography gutterBottom variant="h4" align="center">
                                {testPodaci.animalsWalked}
                            </Typography>

                            <Typography gutterBottom variant="subtitle1" align="center">
                                pasa šetano
                            </Typography>
                        </Box>
                    </Box>
                </div>
            ) : (
                <>
                    <div className="center">
                        You are not logged in. If you already have account please
                    <a href="/login"><Button className="btn" onClick={() => history.push("/login")}>Log in</Button></a>
                    or if you don't fell free to
                        <a href="/registration"><Button className="btn" onClick={() => history.push("/registration")}>Register</Button></a>

                    </div>
                </>
            )}



        </div>
    );
}

export default ProfileScreen
